import "./App.css";
import Home from "./home/Home";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
    return (
        <Switch>
            <div className="App">
                <Route path="/">
                    <Home />
                </Route>
            </div>
        </Switch>
    );
}

export default App;
